import React from "react";
import './section2.css';

const Section2 = () => {
       return(
       <>
      <div className="responsive-container">
      <div className="image_about">
        <img src="./about us.jpg" alt="Description" />
      </div>
      <div className="text_about">
        <p>Your text goes here.</p>
      </div>
    </div>
       </>
       )
}
export default Section2;
